import React, { Component } from "react";

class MaterialItem extends Component {
  constructor(props) {
    super(props);
    this.state = { 
      data: props.data,
      index: props.index
    };
  }

  render() {
    if (!this.state) {
      return null;
    }
    console.log('material item: ', this.state.data);
    return (
      <li key={this.state.index}>{this.state.data.name}</li>
    )
  }
}

export default MaterialItem;
